// src/components/TimeSlots.js

import React from 'react';
import './TimeSlots.css';

const TimeSlots = ({ day, handleSlotClick }) => {
  const generateTimeSlots = () => {
    const timeSlots = [];
    for (let i = 8; i <= 18; i += 2) {
      timeSlots.push({
        slot: `${i}:00 - ${i + 2}:00`,
        isReserved: false,
      });
    }
    return timeSlots;
  };

  return (
    <div className="time-slots-card">
      <h4>Time Slots for {day}:</h4>
      <div className="time-slots-container">
        {generateTimeSlots().map((timeSlot, index) => (
          <div
            key={index}
            onClick={() => handleSlotClick(day, timeSlot.slot)}
            className={`time-slot-card ${timeSlot.isReserved ? 'reserved' : ''}`}
          >
            {timeSlot.slot}
          </div>
        ))}
      </div>
    </div>
  );
};

export default TimeSlots;
